} else {
    /* some error */
    ngx_log_error(NGX_LOG_ALERT, log, 0, ngx_regex_exec_n " failed: %i", n);
}

ngx_regex_exec()的参数是：编译过的正则表达式re，
需要匹配的字符串s，用于保存发现的捕获及其大小的可选的整型数组。
根据PCRE API的要求，捕获数组大小必须是三的倍数。
在例子中，它的大小是从捕获的总数加上一个匹配的字符串本身计算的。
